import React from 'react';
import "./MealList.css";


const MealList = () => {

    const mealItem = [
        {
            id: 1,
            name: "Sushi",
            descriptiom: "Finest fish and veggies",
            price: 22.99
        },
        {
            id: 2,
            name: "Schnitzel",
            descriptiom: "A german speciality!",
            price: 16.50
        },
        {
            id: 3,
            name: "Barbecue Burger",
            descriptiom: "America, raw, meaty",
            price: 12.99
        },
        {
            id: 4,
            name: "Green Bowl",
            descriptiom: "Healthy...and green...",
            price: 16.00
        }
    ]

  return (
    <div>
      {mealItem.map((item) => {
        return(
            <div>
                <div>
                    <h4>{item.name}</h4>
                </div>
                <div>
                    <p>{item.descriptiom}</p>
                </div>
                <div>
                    <h3>${item.price.toFixed(2)}</h3>
                </div>
            </div>
        )
      })}
    </div>
  )
}

export default MealList
